import React from "react";
import { Router } from "react-router-dom";
import { HashLink as Link } from "react-router-hash-link"

import "./Nav.css"

function Nav() {

    return(
        <nav>
            <Link to="/">ABOUT</Link>
            <Link to="#projects">PORTFOLIO</Link>
            <Link to="#">CONTACT</Link>
        </nav>
    );
}

export default Nav;
